import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, TextInput, Button, SafeAreaView, View } from 'react-native';
import firebase from "firebase";

var config = {
  databaseURL: "https://sneh-33f7d-default-rtdb.firebaseio.com",
  projectId: "sneh-33f7d",
};

if (!firebase.apps.length) {
  firebase.initializeApp(config);
}

let name = "", age = "", symptoms = "";
let testing = "test";
firebase.database().ref('UsersList/').push({
})


export default class NameForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = { name: '', age: '', symptoms: '' };

    this.handlenameChange = this.handlenameChange.bind(this);
    this.handleageChange = this.handleageChange.bind(this);
    this.handlesymptomsChange = this.handlesymptomsChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handlenameChange(event) {
    this.setState({ name: event.target.value });
  }
  handleageChange(event) {
    this.setState({ age: event.target.value });
  }
  handlesymptomsChange(event) {
    this.setState({ symptoms: event.target.value });
  }

  handleSubmit(event) {
    name = this.state.name;
    age = this.state.age;
    symptoms = this.state.symptoms;
    firebase.database().ref('UsersList/').push({
      name,
      age,
      symptoms

    })
    alert('A name was submitted: ' + name);

  }

  render() {
    return (
      <SafeAreaView>
        <View>

          <TextInput placeholder="Name" type="text" value={this.state.name} onChange={this.handlenameChange} />

          <TextInput placeholder="Age" type="text" value={this.state.age} onChange={this.handleageChange} />

          <TextInput placeholder="Symptoms" type="text" value={this.state.symptoms} onChange={this.handlesymptomsChange} />

          <Button
            title="Submit"
            onPress={this.handleSubmit}
          />

        </View>
      </SafeAreaView>
    );
    }
}



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
